import React from "react";
import Experience from "./components/Experience";
import Education from "./components/Education";
import About from "./components/About";
import ProgrammingSkills from "./components/ProgrammingSkills";
import SoftwareSkills from "./components/SoftwareSkills";
import experience from "./data/experience"


const education = [
    {
        id: 1,
        school: 'Haaga-Helia University of Applied Sciences',
        degree: "Business Information Technology, Bachelor's Degree",
        startTime: '1/2014',
        endTime: '9/2018',
    },
    {
        id: 2,
        school: 'Eira High School for Adults',
        degree: 'The Finnish Matriculation Examination',
        startTime: '1/2008',
        endTime: '6/2013',
    }
]



const programming = [
    {
        id: 1,
        language: 'HTML & CSS',
        rate: '4/5',
    },
    {
        id: 2,
        language: 'JavaScript',
        rate: '3/5',
    },
    {
        id: 3,
        language: 'React',
        rate: '3/5',
    },
    {
        id: 4,
        language: 'XML',
        rate: '2/5',
    },
    {
        id: 5,
        language: 'SQL',
        rate: '2/5',
    },
    {
        id: 6,
        language: 'Java',
        rate: '2/5',
    },
]


const software = [
    {
        id: 1,
        name: 'Adobe Photoshop',
        rate: '4/5',
    },
    {
        id: 2,
        name: 'Adobe Illustrator',
        rate: '4/5',
    },
    {
        id: 3,
        name: 'Final Cut Pro',
        rate: '3/5',
    },
    {
        id: 4,
        name: 'Microsoft Office',
        rate: '5/5',
    },
    {
        id: 5,
        name: 'Mac OS',
        rate: '4/5',
    },
    {
        id: 6,
        name: 'Microsoft Windows',
        rate: '5/5',
    },
]


const App = () => {

    return (

            <div className="grid-container">
                <div className="item1">About</div>
                <div className="item2">
                    <h2>Programming Skills</h2>
                    <ul>
                        {programming.map(programming =>
                            <ProgrammingSkills key={programming.id} programming={programming} />
                            )}
                    </ul>
                    <h2>Software Skills</h2>
                    <ul>
                        {software.map(software =>
                            <SoftwareSkills key={software.id} software={software} />
                            )}
                    </ul>
                </div>
                <div className="item3">
                    <h2>About me</h2>
                    <About />
                    <h2>Education</h2>
                    <ul>
                        {education.map(education => 
                            <Education key={education.id} education={education} />
                            )}
                    </ul>
                    <h2>Experience</h2> 
                    <ul>
                        {experience.map(experience => 
                            <Experience key={experience.id} experience={experience} />
                        )}
                    </ul>
                </div>
            </div>
    )
}

export default App;
